import React from 'react';

const PokemonDetailPage = ({ match }) => {
  const {
    params: { pokemonId },
  } = match;

  return (
    <div>
      Book details page: <strong>{pokemonId}</strong>
    </div>
  );
};

export default PokemonDetailPage;
